הערה:
ה-S10 True Bone Conduction כולל מצב MP3 ומצב Bluetooth, אנא בחר את המצב הנכון לפי הצרכים שלך, תודה!
על S10 איך להוריד מוזיקה (מצב MP3)
1: ראשית, מחבר את האוזניות והמחשב עם כבל הנתונים המשלים;
2: אז זה יתפוס באופן אוטומטי את הדיסק U, פתח את הדיסק U;
3: פתח תוכנה להאזנה באופן אקראי, לחפש את השיר שברצונך להוריד, לחץ להוריד, לחכות להוריד, לחץ להוריד באופן מקומי, לחץ על מיקום הקובץ של השיר;
4: סוף סוף, שירים בפורמט MP3 שהורדו, ניתן למשוך לדיסק U. ניתן להשלים.

